/**
 * Parses the image data returned by Flickr into the format expected by the
 * Image component.
 * @param  {Object} data A Flickr image object
 * @return {Object}      An object that matches the Image component's prop types
 */
const parseFlickrImageData = data => {
  return {
    author: data.author,
    date: data.date_taken,
    link: data.url_s,
    id: data.id,
    title: data.title,
    url: data.url_s,
  }
}

export {
  parseFlickrImageData
}
